#include <iostream>
#include <vector>
using namespace std;
class Solution {
private:
    string LRjustify(vector<string>&words, int mw, int tot, int i, int j) {
        int len = (j - i == 0) ? 1 : j - i;
        int space = mw - tot;
        int evenDist = space / len;
        int extra = space % len;
        string ans = "";
        ans += words[i++];
        if(i > j) ans += string(evenDist, ' ');
        while(i <= j) {
            if(extra > 0) ans += string(evenDist + 1, ' '), extra--;
            else ans += string(evenDist, ' ');
            ans += words[i++];
        }
        return ans;
    }
    string Ljustify(vector<string>&words, int mw, int i, int j) {
        string ans = "";
        ans += words[i++];
        while(i <= j) {
            ans += " " + words[i++];
        }
        while(ans.length() < mw) {
            ans += " ";
        }
        return ans;
    }
public:
    vector<string> fullJustify(vector<string>& words, int maxWidth) {
        int n = words.size();
        vector<string> ans;
        int i = 0;
        int charSum = -1;
        int wordSum = 0;
        for(int j = 0; j < n; j++) {
            charSum += 1 + words[j].length();
            wordSum += words[j].length();
            if(charSum > maxWidth || j == n - 1) {
                if(charSum > maxWidth) {
                    ans.push_back(
                        LRjustify(words, maxWidth, wordSum - words[j].length(), i, j - 1)
                    ), i = j--;
                }
                else {
                    ans.push_back(Ljustify(words, maxWidth, i, j));
                }
                charSum = -1, wordSum = 0;
            }
        }
        return ans;
    }
};
